window.bookSummaryJSON = "<p>On the border of Zahl-Legion space, far from anything Austin Stone has ever known, Star Runners are dying. Lurking in the darkness, the Zahl Empire has a new threat facing the Legion Tridents. After surviving pirates and battling threats to Earth, Austin knows better than most rookies in the Tizona Squadron the dangers that exist in the universe. </p> <p>Soon after his tour begins, a mysterious weapon strikes fear in the hearts of all Star Runners and has the ability to catapult the Legion and Zahl into a galactic war. </p> <p>Dealing with plunging morale and missing comrades, Austin has to deal with the fact they are facing an enemy they cannot defeat. But perhaps the Legion could find another way to face the enemy.... </p>"; 
